INSERT INTO `tb_pandangan_frase` (`id_pandangan_frase`, `deskripsi_pandangan_frase`, `kelas_dokumen`) VALUES
(1, 'pelaku lgbt memang pantas dibunuh karena perilaku mereka bisa mendatangkan murka-alloh spt halnya kaum nabi luth', -1),
(2, 'ahok si anjing kafir china jelas udah melecehkan islam penghina-islam seperti ahok pantas utk dipenggal', -1),
(3, 'para kafir yg bawa islam-radikal mreka ini dkhawatirkan akan mrayu orang baik manusiawi dan berbudi-baik mjadi terrorris astagfirullah', -1),
(4, 'pemikiran-radikal khawarij bisa diperbaiki dengan keadilan dan kebenaran oleh ustadz budi ashari lc', 1),
(5, 'jihad tanpa ijtihad sama buruknya dengan kerja tanpa-kritik', 1),
(6, 'bagi siapa saja yang anti-pancasila sebaiknya jangan-tinggal di indonesia pancasila masih dasar-negara dan ideologi-bangsa belum diubah', 1);
INSERT INTO `tb_pandangan_frase_uji` (`id_pandangan_frase`, `deskripsi_pandangan_frase`, `kelas_dokumen`) VALUES
(1, 'paus fransiskus islam tak terkait terorisme', 1),
(2, 'mengubah diri kepada lebih baik juga dianggap sebagai jihad', 1),
(3, 'mereka banciiii semua jakarta masih di kuasai koruptor dan kaumradikal tengiiik yg gak mau ahok tampil lagi', -1),
(4, 'allah tidak sama dgn ketuhanan yang maha esaallah dlm quran dgn tegas menyebut namanyatdk pernah bilang sila', -1);
